        require(amount <= investedAmount, "Redeem amount exceeds invested balance");

        // Redeem cUSDT tokens and get back USDT
        uint256 redeemResult = cUSDT.redeem(amount);
        require(redeemResult == 0, "cUSDT redemption failed");

        // Transfer the redeemed USDT back to the owner
        require(usdtToken.transfer(owner, amount), "USDT transfer failed");
